Insurance:
["During the Term of the Agreement, LMG shall maintain and keep in force, at its own expense, the following minimum insurance coverages and minimum limits:

workers' compensation insurance, with statutory limits as required by the various laws and regulations applicable to the employees of LMG;

employer's liability insurance, for employee bodily injuries and deaths, with a limit of $500,000 each accident;

commercial general liability insurance, covering claims for bodily injury, death and property damage, including premises and operations, LMG's vicarious liability for acts of independent contractors, products, services and completed operations (as applicable to the Services), personal injury, contractual, and broad-form property damage liability coverages, with combined single limit of $1,000,000 per occurrence, and a general aggregate limit of $2,000,000, for bodily injury, death and property damage;

commercial automobile liability insurance, covering owned, non-owned and hired vehicles, with combined single limit of $1,000,000 per occurrence;

umbrella liability insurance, with a minimum limit of $5,000,000 per occurrence and $5,000,000 in the aggregate;

special form property insurance, on a replacement cost basis, covering the real and personal property of LMG which LMG is obligated to insure by the Agreement; such real and personal property may include equipment, furniture, fixtures and supply inventory; and

employee dishonesty insurance covering dishonest acts of employees; such insurance shall include a Joint Loss Endorsement in favor of TAG and be written for limits not less than $500,000.", 'TAG shall be named as loss payee as its interest may appear on the property insurance policies of LMG. LMG shall be responsible for payment of any and all deductibles from insured claims under its policies of insurance.', 'All required policies of insurance will be placed with insurers with no less than an A.M. Best rating of A- VII.']

Cap On Liability:
['Neither Customer nor M&I shall be liable for, nor will the measure of any damages in any event include, any indirect, incidental, punitive, special or consequential damages or amounts for loss of income, profits or savings arising out of or relating to performance or non-performance under this Agreement.', "Notwithstanding any provision in the Agreement to the contrary, M&I's liability to Customer for claims arising out of the ACH Services performed by M&I pursuant to this Section 6.5 shall be limited to errors and omissions which are caused solely by M&I's gross negligence or willful misconduct and which cannot be remedied through the processing of appropriate corrected ACH Entry(ies).", "Notwithstanding any provision in this Agreement, M&I's total liability under this Agreement shall not exceed payments made to M&I by Customer under this Agreement during the three (3) months prior to the event.", "Customer and M&I shall be liable to the other only for direct damages arising out of or relating to their respective performance or non-performance of obligations under this Agreement; provided, however, that the following shall be considered direct damages for the purposes of this Agreement:

          A.   Costs of recreating or reloading any of Customer's information that is lost or damaged;

          B.   Costs of implementing a work-around in respect of a failure to provide the Services;

          C.   Costs of replacing lost or damaged equipment, software, and materials;

          D.   Costs and expenses incurred by Customer to correct errors in software maintenance and enhancements provided as part of the Services;

          E.   Costs and expenses incurred by Customer to procure the Services from an alternate source, to the extent in excess of M&I's charges under this Agreement; and

          F.   Straight time, overtime, or related expenses incurred by Customer, including overhead allocations of Customer for Customer's employees, wages and salaries of additional employees, travel expenses, overtime expenses, telecommunication charges, and similar charges, due to failure of M&I to provide the Services or incurred in connection with subsections (A) through (E) above, to the extent that such straight time, overtime, or related expenses exceed what Customer would have paid to M&I if M&I were providing the Services, and limited to the amount that M&I would have paid to Customer under subsection (E) above if Customer chose to procure the Services from an alternate source."]

Insurance:
['Certificates of Insurance evidencing all coverages described in this Section shall be furnished to Customer upon request.', 'To the extent any insurance coverage required under this Section is purchased on a "claims-made" basis, such insurance shall cover all prior acts of Metavante during the Term, and such insurance shall be continuously maintained until at least four (4) years beyond the expiration or termination of the Term, or Metavante shall purchase "tail" coverage, effective upon termination of any such policy or upon termination or expiration of the Term, to provide coverage for at least four (4) years from the occurrence of either such event.', "Metavante currently maintains and, if available at a reasonable cost, Metavante shall continue to pay for, and maintain in full force and effect during the Term insurance as follows:

A. Workers' compensation and employers' liability insurance with limits to conform with the greater of the amount required by Wisconsin applicable state statutory law or one million dollars ($1,000,000) each accident, including occupational disease coverage;

B. Commercial general liability insurance with limits not less than three million dollars ($3,000,000) combined single limit for bodily injury, death, and property damage, including personal injury, contractual liability, independent contractors, broad-form property damage, and products and completed operations coverage;

C. Commercial automobile liability insurance with limits not less than one million dollars ($1,000,000) each occurrence combined single limit of liability for bodily injury, death, and property damage, including owned and non-owned and hired automobile coverages, as applicable;

D. Commercial Blanket Bond, including Electronic & Computer Crime or Unauthorized Computer Access coverage, in the amount of not less than ten million dollars ($10,000,000); and

E. Professional liability insurance (Errors and Omissions) with limits not less than three million dollars ($3,000,000) annual aggregate for all claims each policy year for computer programming and electronic data processing services."]

['Each Party shall purchase and maintain, at its own expense, the        following insurance coverages:

    (a)     cargo liability insurance, subject to a combined single limit of                not less than One Hundred Thousand dollars ($100,000.00)                inclusive per occurrence. The other Party shall be named as an                additional insured and the policy shall contain a cross                liability clause;

    (b)     automobile, non-owned automobile, fleet, comprehensive general,                public and property liability insurance with a limit of not less                than Two Million dollars ($2,000,000.00) inclusive of bodily                injury and property damage for any one occurrence arising out of                one (1) cause. The policy shall cover all non-air operations,                non-owned automobile, contractual liability and liability                specifically assumed under this Agreement. The other party shall                be named as an additional insured and the policy shall contain a                cross liability clause;', 'Each Party shall deliver to the other, prior to commencing to provide        the Services and thereafter, annually, a certificate or certificates of        insurance evidencing that the required insurance coverages as        provided for in paragraph 9.1 are in effect and that each Party shall be        given thirty (30) days prior written notice of cancellation or         expiry of or material change to such insurance coverages.', 'Each Party shall maintain the insurance coverages provided for in        paragraph 9.1 hereof, in full force and effect during the term of        this Agreement and covenants that nothing shall be done whereby any        policy will be cancelled and shall pay all renewal premiums thereon on or        before the due date and shall forthwith furnish the other Party with        copies of certificates of insurance of such renewals.', 'Each Party shall ensure that any subcontractor or other party with whom        it contracts in providing the Services shall carry adequate        insurance coverage, but not less than that provided in paragraph 9.1.']

